import React from 'react';
import Storm from '../Storm.png'
import './Team.css'

function Team() {
    return (
        <div className='Team'>
            <img src={Storm} className='Storm'>
                <h2>STORM#2856</h2>
            </img>

        </div>
    );
}

export default Team;
